import React from 'react';

const SocialMedia = () => {
    return (
        <>
            <div className="row">
                <div class="grid text-center">
                    <div class="g-col-6">Contact Us</div>
                    <div class="g-col-6">About Us</div>

                    <div class="g-col-6">Facebook</div>
                    <div class="g-col-6">Instagram</div>


                </div>
            </div>
        </>
    );
};

export default SocialMedia;
